import { useEffect, useState } from 'react';
import './Movies.scss';
import axios from 'axios';


const Movies = () => {
    const [Movies, setMovies] = useState([])

    useEffect(() => {
        getMovies()
    }, [])



    function getMovies() {

       const getMovies =  axios.get('https://jsonplaceholder.typicode.com/users')

       getMovies.then(function (response) {
                // handle success
                setMovies(response)
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            })
            .finally(function () {
                // always executed
                console.log(Movies);
            });
    }

    return (
        <div>
            {
                Movies && Movies.map((item)=>{
                    <p>{item.name}</p>
                })
            }
        </div>
    )
}

export default Movies;
